import React from "react";
import CartButton from "../UI/CartButton";

function Header() {
  return (
    <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fmedia.istockphoto.com%2Fid%2F181956140%2Fphoto%2Ffoods.jpg%3Fs%3D612x612%26w%3D0%26k%3D20%26c%3DFEEr6bae_sTDflmmArQCuuWcHliyi249kOIFYC3nDgE%3D&imgrefurl=https%3A%2F%2Fwww.istockphoto.com%2Fphotos%2Flots-of-food&tbnid=q86O0mZUj1_NFM&vet=12ahUKEwjhncfUv6v9AhV503MBHbIKDcAQMygGegUIARDSAQ..i&docid=hrCB_kGeQhoFyM&w=612&h=407&q=lots%20of%20foooooood&ved=2ahUKEwjhncfUv6v9AhV503MBHbIKDcAQMygGegUIARDSAQ">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div
          className="container-fluid border border-4 rounded-3 
">
          <h2>Meal Application</h2>
          <CartButton className="btn btn-primary" amount={9}>
            Cart
          </CartButton>
        </div>
      </nav>
    </img>
  );
}

export default Header;
